        data_type: TYPE_INT32
        dims: [2]
    output:
      - name: OUTPUT_0
        data_type: TYPE_FP16
        dims: [3, -1, -1]
      - name: OUTPUT_1
        data_type: TYPE_FP32
        dims: [2]
      - name: OUTPUT_2
        data_type: TYPE_FP32
        dims: [2]